import React from 'react'
import {ERROR_ROUTER} from '../../Constants'

const ErrorRouter = () =>{
  return (
    <div className='errorRouter'>
      <p className='error'>{ERROR_ROUTER}</p>
    </div>
  )
} 

export default ErrorRouter
